                var sdl2 = {
                    4: 9,
                    10: 7,
                    11: 8,
                    6: '\"+4\"',
                    7: '\"+5\"'
                }

                if (sdl2[assignment]) {
                    assignment = sdl2[assignment];
                }
                inputConfig += assignment + '\n';
